import React , {useState} from "react";
import "./App.css";
import axios from 'axios';
 //jest.unmock('axios');
import gptLogo from "./assets/chatgpt.svg";
import addBtn from "./assets/add-30.png";
import msgIcon from "./assets/message.svg";
import home from "./assets/home.svg";
import saved from "./assets/bookmark.svg";
import rocket from "./assets/rocket.svg";
import sendBtn from "./assets/send.svg";
import userIcon from "./assets/user-icon.png";
import gptImgLogo from "./assets/chatgptLogo.svg";
const { BardAPI } = require("bard-api-node");



function App() {
    
    const [input , setInput] = useState(""); 

   // const assistant = new BardAPI();

    async function handleClick() {
        try {
          const assistant = new BardAPI();
      
          // Set session information for authentication
          await assistant.setSession('__Secure-1PSID', 'awhP6NGQvfvPLAj0UEadlrA-Nod57n6rummA7d203ZBHH9tErhiPVPYmetXRIkfXvgZWkw.'); // or '__Secure-3PSID'
          // ...
      
          // Send a query to Bard
          const response = await assistant.getBardResponse('Hello, how are you?');
          console.log('Bard:', response.content);
        } catch (error) {
          console.error('Error:', error);
        }
      }

    return (
        <div className="App">
            <div className="sideBar">
                <div className="upperSide">
                    <div className="upperSideTop">
                        <img src={gptLogo} className="logo" />
                        <span className="brand">ChatGPT</span>
                    </div>

                    <button className="midBtn"><img src={addBtn} alt="new chat" className="addBtn" />New Chat</button>

                    <div className="upperSideBottom">
                        <button className="query"><img src={msgIcon} alt="Query" />What is programming?</button>
                        <button className="query"><img src={msgIcon} alt="Query" />How to use an API?</button>
                    </div>

                </div>
                <div className="lowerSide">
                    <div className="listItems">
                        <img src={home} alt="home" className="listItemsImg" />
                        Home
                    </div>
                    <div className="listItems">
                        <img src={saved} alt="saved" className="listItemsImg" />
                        Saved
                    </div>
                    <div className="listItems">
                        <img src={rocket} alt="rocket" className="listItemsImg" />
                        Upgrade to pro
                    </div>
                </div>
            </div>


            <div className="mainBar">
                <div className="chats">
                    <div className="chat">
                        <img className="chatImg" src={userIcon} alt=""/>
                        <p className="txt">
                            hello how are you i am jarvis.
                        </p>
                    </div>
                    <div className="chat bot">
                        <img className="chatImg" src={gptImgLogo} alt=""/>
                        <p className="txt">
                           hello how are you i am jarvis.hello how are you i am jarvis.hello how are you i am jarvis.hello how are you i am jarvis.hello how are you i am jarvis.hello how are you i am jarvis.hello how are you i am jarvis.hello how are you i am jarvis.hello how are you i am jarvis.hello how are you i am jarvis.hello how are you i am jarvis.hello how are you i am jarvis.
                           hello how are you i am jarvis.hello how are you i am jarvis.hello how are you i am jarvis.hello how are you i am jarvis.hello how are you i am jarvis.
                           hello how are you i am jarvis.hello how are you i am jarvis.hello how are you i am jarvis.hello how are you i am jarvis.hello how are you i am jarvis.
                           hello how are you i am jarvis.hello how are you i am jarvis.hello how are you i am jarvis.hello how are you i am jarvis.
                        </p>
                    </div>
                </div>

                <div className="chatFooter">
                    <div className="inp">
                        <input type="text" placeholder="type your query" value={input} onChange={(e) => {setInput(e.target.value)}} />
                        <button className="send" onClick={handleClick}>
                            <img src={sendBtn} alt="send" />
                        </button>
                    </div>
                    <p>
                        chatGPT may produce wrong information about people , places or facts.
                    </p>
                </div>
            </div>


        </div>
    )
}

export default App;
